css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document url-prefix("http://www.google."),
url-prefix("https://www.google."){

/*image*/
.csb{
	background-image: url("data:image/png;base64,") !important;
	height: 45px !important;
	margin-bottom: 7px !important;
}
.b:first-child .csb{
	background-position: 0 0 !important;
	width: 29px !important;
}
.b:first-child > a:hover > .csb{
	background-position: 0 -45px !important;
}
.cur > .csb{
	background-position: -28px -45px !important;
	width: 20px !important;
}
.fl > .csb{
	background-position: -28px 0 !important;
	width: 20px !important;
}
.fl:hover > .csb,
#nav td:not(.b) > span.csb.ch{
	background-position: -28px -45px !important;
}
.b:last-child > a > .csb{
	background-position: right 0 !important;
	width: 40px !important;
}
.b:last-child > a:hover > .csb{
	background-position: right -45px !important;
}

/*text*/
.b:first-child > a > .csb + span{
	margin-right: 5px !important;
}
.b:last-child > a > .csb + span{
	margin-left: 5px !important;
}
.b:last-child > a > #knavm{
	left: 5px !important;
}
.g #knavm{
	left: 0 !important;
	top: 4px !important;
}
.pn,
.fl{
	color: #999 !important;
	text-decoration: none !important;
}
#nav .b a{
	color: #999 !important;
}
.cur,
.pn:hover,
.fl:hover,
#nav .b a:hover{
	color: #444 !important;
}

}
